    const [customerData, setCustomerData] = useState(null);
  
    useEffect(() => {
      fetchCustomerData();
    }, []);
  
    const fetchCustomerData = async () => {
      try {

        debugger;


        const response = await fetch('https://localhost:44375/weatherforecast');
        
        //await fetch('/api/customers'); // Replace with your API endpoint  https://localhost:44375/weatherforecast
        const data = await response.json();
        setCustomerData(data);
      } catch (error) {
        console.error('Error fetching customer data:', error);
      }
    };
  
    return (
      <div>
 Display customer data

        {/* Display customer data */}
        {customerData && (
          <ul>



            {customerData.map((customer) => (
              <li key={customer.id}>
                {customer.name} - {customer.email}
              </li>
            ))}
          </ul>
        )}
      </div>
    );
  };
